import React from 'react'
import Chart from '../Chart/Chart'

function ExpenseChart(props) {
  const chartdatapionts=[
    {label:'jan',value:0},
    {label:'Feb',value:0},
    {label:'Mar',value:0},
    {label:'Apr',value:0},
    {label:'May',value:0},
    {label:'Jun',value:0},
    {label:'Jul',value:0},
    {label:'Aug',value:0},
    {label:'Sep',value:0},
    {label:'Nov',value:0},
    {label:'Dec',value:0} 
  ];
  for(const expense of props.expense){
    const expenseMonth=expense.data.getMonth();
    chartdatapionts[expenseMonth].value+=expense.amount;
  }
  return (
    <div>
      <Chart dataPionts={chartdatapionts}></Chart>
    </div>
  )
}

export default ExpenseChart
